import React from 'react';
import Typography from '@material-ui/core/Typography';

export const QuoteDetail = props => {

    console.log(props)

   const {
        symbol,
        name,
    } = props.record;

    return (
        <div style={{padding: '1%', borderStyle: 'solid', borderWidth: '1px'}}>
            <h4 style={{padding: '0%'}}>Quote Details</h4>
            <div style={{backgroundColor: 'green', color: 'white', padding: '1%'}}>{name}</div>
            <Typography variant="h5" component="h2">{symbol}</Typography>
            <Typography variant="body2" component="p">
          well meaning and kindly.
          <br />
          {'"a benevolent smile"'}
        </Typography>
        </div>

    );

}
